import {useGetLaunchesQuery} from "./api/spaceXApi";
import {useState} from "react";

const spaceXLaunches = () => {
    const [sortArg, setSortArg] = useState(-1);
    const {data, isLoading, error} = useGetLaunchesQuery(sortArg);
    console.log("launches");
    console.log(data);

    return (
        <>{error ? (
            <>Oh no, there was an error</>
        ) : isLoading ? (
            <>Loading...</>
        ) : data ? (
            <>
                <select
                    onChange={(change) => setSortArg(Number(change.target.value))}
                >
                    <option value={-1}>Сначала последние</option>
                    <option value={1}>Сначала первые</option>
                </select>
                <ul>
                    {data.map((launch) => (
                        <li key={launch.id}>{launch.details}</li>
                    ))}
                </ul>
            </>
        ) : null}
        </>
    );
}

export default spaceXLaunches();
